import React, { Component } from "react";

class Hi extends Component {
  state = {};
  render() {
    return (
      <div>
        <section id="hello" class="container section">
          <div class="row">
            <div class="col-md-12">
              <h1
               
                class="section__title"
                style={{textIndent: "0px", fontWeight: "bolder"}}
              >
                Hi_
              </h1>
              <div className="container">

              </div>
            
            </div>
          </div>
        </section>
      </div>
    );
  }
}

export default Hi;
